package com.kuaixiu.sjUser.entity;import com.common.base.entity.BaseEntity;/** * . * * @CreateDate: 2019-05-06 上午10:45:46 * @version: V 1.0 */public class MenuRole extends BaseEntity {        /**     * 序列化Id     */    private static final long serialVersionUID = 1L;    /**     *      */    private Long id ;    /**     * 权限id     */    private String roleId ;    /**     * 登录id     */    private String loginId ;    /**     * 菜单id     */    private Long menuId ;    public Long getId(){        return this.id;    }    public void setId(Long id){        this.id=id;    }    public String getRoleId(){        return this.roleId;    }    public void setRoleId(String roleId){        this.roleId=roleId;    }    public String getLoginId(){        return this.loginId;    }    public void setLoginId(String loginId){        this.loginId=loginId;    }    public Long getMenuId(){        return this.menuId;    }    public void setMenuId(Long menuId){        this.menuId=menuId;    }}